function setMaxTransactionAmount(uint256 newMaxTxAmount) public {
    require(msg.sender == owner, "Ownable: caller is not the owner");
    require(newMaxTxAmount > 0, "Max transaction amount must be greater than zero");
    maxTransactionAmount = newMaxTxAmount;
    emit MaxTransactionAmountChange(newMaxTxAmount, maxTransactionAmount);
}

